                                                            <h2 class="font_2" style="font-size:38px; line-height:normal; text-align:center;"><span style="font-size:38px;"><span class="color_15"><span style="letter-spacing:0.12em;"><span style="font-family:playfairdisplay-bold,playfair display,serif;"><span class="backcolor_13">Interactive</span></span></span></span></span></h2>
                                                        </div>
                                                        <div id="comp-l4rm3il5" class="_2Hij5 _3bcaz" data-testid="richTextElement">
                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">Interaction and communication is key!</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="wixGuard">​</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">With us we first start with 5 live classes every week, this is to ensure that more are able to come to at least 1, even if it is a small class we are able to have more back and forth communication and personalized help.</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="wixGuard">​</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">As we developed and our teams grow, we are able to add more classes with more leaders, one of our unwritten goals is to have training in every area online, and have it all available with no extra cost&nbsp;</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="wixGuard">​</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">Interaction also allows us to quickly identify action takers, and dreamers with vision, this allows us to connect and grow teams within all areas with all the right skills to ensure the best chances of success.</span></span></span></p>
                                                        </div>
                                                        <div id="comp-l4qepomk" class="_1F6na">
                                                            <div data-testid="linkElement" class="_2tcsV">
                                                                <wix-image id="img_comp-l4qepomk" class="_1-6YJ _3_NbI" data-image-info="{&quot;containerId&quot;:&quot;comp-l4qepomk&quot;,&quot;displayMode&quot;:&quot;fill&quot;,&quot;imageData&quot;:{&quot;width&quot;:640,&quot;height&quot;:490,&quot;uri&quot;:&quot;6dee8a_79f4b2a997e647fca8d15064013d826d~mv2.jpg&quot;,&quot;name&quot;:&quot;brain-g3a0cbdcc2_640.jpg&quot;,&quot;displayMode&quot;:&quot;fill&quot;}}" data-bg-effect-name="" data-image-zoomed="" data-has-ssr-src="true"><img src="https://static.wixstatic.com/media/6dee8a_79f4b2a997e647fca8d15064013d826d~mv2.jpg/v1/fill/w_155,h_119,al_c,q_80,usm_0.66_1.00_0.01,blur_2,enc_auto/brain-g3a0cbdcc2_640.jpg" alt="brain-g3a0cbdcc2_640.jpg" style="width:523px;height:396px;object-fit:cover;object-position:50% 50%" loading="lazy" /></wix-image>
                                                            </div>
                                                        </div>
                                                        <div id="comp-l4qfeuwx" class="_2Hij5 _3bcaz" data-testid="richTextElement">
                                                            <h2 class="font_2" style="font-size:38px; line-height:normal; text-align:center;"><span style="font-size:38px;"><span class="color_15"><span style="letter-spacing:0.12em;"><span style="font-family:playfairdisplay-bold,playfair display,serif;"><span class="backcolor_13">Team Work</span></span></span></span></span></h2>
                                                        </div>
                                                        <div id="comp-l4rlibek" class="_2Hij5 _3bcaz" data-testid="richTextElement">
                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">Teamwork works! we work as a team to build each other, this has been on offer with so many companies yet in most cases, the team will collapse, which in turn has made the online game shift into a direction of everyone for themselves.</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="wixGuard">​</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">The reason others fail here is actually a simple problem to solve, when joining a team online the leaders normally depend on the team to generate results, this makes them rush the recruiting and turns a leader into a boss, pushy, and arrogant, but with us...</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="wixGuard">​</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">We are not reliant on recruiting, we move slowly in our growth and find others with vision and ideas of their own, we then work with them and their vision to help create and monetize what they want to do. If what they create aligns with us, we then have everyone in our team get behind this and help skyrocket it to success.</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="wixGuard">​</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">Not everyone that joins with us has creative minds or an entrepreneur spirit, but everyone with us becomes the support of the select few that do, while also getting rewarded for it!</span></span></span></p>
                                                        </div>
                                                        <div id="comp-l4qemqm8" class="_3vYzk">
                                                            <div data-testid="linkElement" class="_3-x13">
                                                                <wix-image id="img_comp-l4qemqm8" class="_1-6YJ _3ErHH" data-image-info="{&quot;containerId&quot;:&quot;comp-l4qemqm8&quot;,&quot;displayMode&quot;:&quot;fill&quot;,&quot;imageData&quot;:{&quot;width&quot;:1920,&quot;height&quot;:1371,&quot;uri&quot;:&quot;6dee8a_8564f65c7f4c42b8b78c9abb386abb1e~mv2.jpg&quot;,&quot;name&quot;:&quot;meet-g9451e7477_1920.jpg&quot;,&quot;displayMode&quot;:&quot;fill&quot;}}" data-bg-effect-name="" data-image-zoomed="" data-has-ssr-src="true"><img src="https://static.wixstatic.com/media/6dee8a_8564f65c7f4c42b8b78c9abb386abb1e~mv2.jpg/v1/fill/w_153,h_109,al_c,q_80,usm_0.66_1.00_0.01,blur_2,enc_auto/meet-g9451e7477_1920.jpg" alt="meet-g9451e7477_1920.jpg" style="width:512px;height:363px;object-fit:cover;object-position:50% 50%" loading="lazy" /></wix-image>
                                                            </div>
