                                                        <div id="comp-l4qfg2y6" class="_2Hij5 _3bcaz" data-testid="richTextElement">
                                                            <h2 class="font_2" style="font-size:38px; line-height:normal; text-align:center;"><span style="font-size:38px;"><span class="color_15"><span style="letter-spacing:0.12em;"><span style="font-family:playfairdisplay-bold,playfair display,serif;"><span class="backcolor_13">Creative</span></span></span></span></span></h2>
                                                        </div>
                                                        <div id="comp-l4rm452b" class="_2Hij5 _3bcaz" data-testid="richTextElement">
                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">Profit stops creativity, this is a fact!</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="wixGuard">​</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">When coming online, you will see many turn from an entrepreneur with ideas, to a salesperson that consistently promotes some millionaire CEO&#39;s platform that offers that are specifically designed to make them rich and on the off chance one of the promoters. We, however...</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="wixGuard">​</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">Have designed our platform to bring back that think for yourself mind frame, we do this with our classes, being interactive and everyone talking about their own ideas, we can then correct wording that has been ingrained into us since birth, spark the ideas of all those in the class, as ideas spark excitement grows and then with little guidance actions follow.</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="wixGuard">​</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">The second step is to take out the beliefs of limitations and lack, this is also quite simple, the limitation side is to get the ideas of the entrepreneur and then break it down for them so they can see the possibility of them achieving it, rather than the impossibility that was put into them.&nbsp;</span></span></span></p>
                                                        </div>
                                                        <div id="comp-l4qfgg43" class="_2Hij5 _3bcaz" data-testid="richTextElement">
                                                            <h2 class="font_2" style="font-size:38px; line-height:normal; text-align:center;"><span class="color_15"><span style="font-size:38px;"><span style="letter-spacing:0.12em;"><span style="font-family:playfairdisplay-bold,playfair display,serif;"><span class="backcolor_13">Solution</span></span></span></span></span></h2>
                                                        </div>
                                                        <div id="comp-l4rm5ito" class="_2Hij5 _3bcaz" data-testid="richTextElement">
                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">This world is profit driven, so we use this to help those that are solution driven.</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13"><span class="wixGuard">​</span></span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">We are a growing team of the most powerful network marketers getting behind solution-driven organizations. &nbsp;Our training is designed to help you and who you are, spark ideas, and dig to what it is you really want before the day you began chasing money, we then work on and amplify that.</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13"><span class="wixGuard">​</span></span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">If your idea is a great one, that will help many, it may be approved to join our advertising service, this is where we leverage all our members to help you grow the idea into massive cooperation.</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13"><span class="wixGuard">​</span></span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13">If for example, your idea is to drill a hole for oil, the income potential is amazing and you will have the backing from many as the world is currently money driven, but if however, your idea is to filter salt water and ensure all the human population on earth had clean water, this idea will struggle to get investment, support, etc as (the world is currently profit driven), and you will more then likely go under, well...</span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;"><span style="font-weight:bold;"><span class="backcolor_13"><span class="wixGuard">​</span></span></span></span></p>

                                                            <p class="font_7" style="font-size:15px; text-align:center;"><span style="font-size:15px;">
                                                                    <span style="font-weight:bold;"><span class="backcolor_13">We are here for the ones with the solutions!</span></span></span></p>
                                                        </div>
